        "def remove_url(text):\n",
        "    ls = []\n",
        "    words = ''\n",
        "    regexp1 = re.compile('http[s]?://(?:[a-zA-Z]|[0-9]|[$-_@.&+]|[!*\\(\\),]|(?:%[0-9a-fA-F][0-9a-fA-F]))+')\n",
        "    regexp2 = re.compile('www?.(?:[a-zA-Z]|[0-9]|[$-_@.&+]|[!*\\(\\),]|(?:%[0-9a-fA-F][0-9a-fA-F]))+')\n",
        "\n",
        "\n",
        "    urls = regexp1.findall(text)\n",
        "\n",
        "    for u in urls:\n",
        "        text = text.replace(u, ' ')\n",
        "\n",
        "    urls = regexp2.findall(text)\n",
        "\n",
        "    for u in urls:\n",
        "        text = text.replace(u, ' ')\n",
        "\n",
        "    return text\n",
        "\n",
        "def remove_regex(text, regex_pattern):\n",
        "\n",
        "    return re.sub(regex_pattern,'',text)\n",
        "\n",
        "def remove_punctuation(text):\n",
        "    punctuation_marks = string.punctuation\n",
        "\n",
        "    text_without_punctuation = text.translate(str.maketrans('', '', punctuation_marks))\n",
        "\n",
        "    return text_without_punctuation\n",
        "\n",
        "\n",
        "def clean(data):\n",
        "  ls = []\n",
        "  for text in data:\n",
        "    text = remove_url(text) # remoção de urls\n",
        "    text = remove_regex(text, '@[\\w]*') # remoção de @usernames\n",
        "    text = remove_regex(text, '#[\\w]*') # remoção de #hashtags\n",
        "    text = remove_regex(text, r'[^a-zA-Z0-9À-ÖØ-öø-ÿç_ ]')#Removendo todos caractéres especiais menos acentuações e underline\n",
        "    ls.append(text)\n",
        "  return ls\n",
        "\n",
        "X_values = clean(X_values)\n",
        "for i in range(0, 5):\n",
        "    print(X_values[i])"
