        "def tratament(data):\n",
        "  data = clean(data)\n",
        "  data = replace_emojis(data, emoji_list)\n",
        "  data_tokens = tokenize_text(data)\n",
        "  data_tokens = apply_standardization(data_tokens, std_list)\n",
        "  data_tokens = rm_stopwords(data_tokens, stopword_list)\n",
        "  data_tokens = stem_txt(data_tokens)\n",
        "  data = untokenize_text(data_tokens)\n",
        "  data_vect = vectorizer.transform(data)\n",
        "  data_tfidf = tfidf_transformer.transform(data_vect)\n",
        "  return data, data_vect, data_tfidf"
