        "res = requests.get('https://project-tcc.vercel.app/api/posts')\n",
        "data_analyse = pd.read_json(res.text)\n",
        "\n",
        "\n",
        "s = SentimentIntensityAnalyzer()\n",
        "\n",
        "def get_sentiment(comment):\n",
        "    prediction = s.polarity_scores(comment)\n",
        "    if prediction['compound'] >= 0.05:\n",
        "        return 'Positivo'\n",
        "    elif prediction['compound'] <= -0.05:\n",
        "        return 'Negativo'\n",
        "    else:\n",
        "        return 'Neutro'\n",
        "\n",
        "data_analyse['sentiment'] = data_analyse['comment'].apply(get_sentiment)\n",
